"use strict";

/**
 * Focus at the end of the document
 * @param  {Slate.Editor} editor
 */
function focusAtEnd(editor) {
  var document = editor.value.document;

  return editor.moveToEndOfNode(document);
}

module.exports = focusAtEnd;
